import React from "react";

function Page({ goNextPage, goPrevPage }) {
    return (
        <div className="buttons">
            {goPrevPage && <button className="button" onClick={goPrevPage}>Previous</button>}
            {goNextPage && <button className="button" onClick={goNextPage}>Next</button>}
        </div>
    )
}

export default Page;
